import React from "react";
import {
  MDBContainer,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavbarToggler,
  MDBCollapse,
  MDBNavItem,
  MDBNavLink,
  MDBIcon
} from "mdbreact";
import { BrowserRouter as Router } from "react-router-dom";

class Navbar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      collapse: false
    };
    this.onClick = this.onClick.bind(this);
  }

  onClick() {
    this.setState({
      collapse: !this.state.collapse
    });
  }

  render() {
    const blue = { backgroundColor: "#33b5e5" };
    const container = { height: 1300 };
    return (
      <div>
        <header>
          <nav className="navbar navbar-expand-lg navbar-light warning-color lighten-5"></nav>
        </header>
      </div>
    );
  }
}

export default Navbar;
